class ViewComponent {
    constructor(sessionsService, router, snackBar, authService, titleService) {
        this.sessionsService = sessionsService;
        this.router = router;
        this.snackBar = snackBar;
        this.authService = authService;
        this.titleService = titleService;
        this.displayedColumns = ['Course Name', 'LTPS', 'Topics Covered', 'D&TOC', 'URL', 'Faculty Name', 'Faculty E - Mail', 'Platform', 'Last Updated', 'Edit', 'Delete', 'View'];
        this.sessions = [];
        this.List = [];
        this.title = 'Sessions Info. - Table View | OnCl - Edu. Cloud';
        this.fetchRecords();
    }
    ngOnInit() {
        this.titleService.setTitle(this.title);
        this.fetchRecords();
    }
    fetchRecords() {
        this.authService.getUserId().subscribe((res) => {
            this.sessionsService.getRecords(res).subscribe((data) => {
                this.List = data;
                this.sessions = this.List;
                this.length = this.sessions.length;
                console.log(this.List);
            });
        });
    }
    delete(id) {
        console.log(id);
        this.sessionsService.deleteRecord(id).subscribe(() => {
            this.snackBar.open('session Deleted !!', 'OK', {
                duration: 3000,
            });
            this.fetchRecords();
        });
    }
    edit(id) {
        this.router.navigate([`edit/${id}`]);
    }
    view(id) {
        this.router.navigate([`view/${id}`]);
    }
    Search() {
        if (this.coname != "") {
            this.sessions = this.List.filter(res => {
                return res.coursename.toLocaleLowerCase().match(this.coname.toLocaleLowerCase());
            });
            this.length = this.sessions.length;
        }
        else if (this.coname == "") {
            this.ngOnInit();
        }
    }
}


